    public static final String CHEATSHEET_TODO = "todo <description>
Adds a new todo to the list.

";

    public static final String CHEATSHEET_DEADLINE = "deadline <description> /by <deadline>
Adds a new deadline to the list.

";

    public static final String CHEATSHEET_EVENT = "event <description> /from <start> /to <end>
Adds a new event to the list.

";

    public static final String CHEATSHEET_DELETE = "delete <task number>
Deletes a task from the list.

";

    public static final String CHEATSHEET_MARK = "mark <task number>
Marks a task from the list as complete.

";

    public static final String CHEATSHEET_UNMARK = "unmark <task number>
Marks a task from the list as incomplete.

";

    public static final String CHEATSHEET_LIST = "list
Displays all current tasks in the list.

";

    public static final String CHEATSHEET_FIND = "find <search>
Returns all the tasks in the list with description matching the search field.

";

    public static final String CHEATSHEET_BYE = "bye
Exits the application.

";
